import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root',
})
export class ApiService {
  constructor() {}

  logIn(name: string, password: string, role: string): Observable<string> {
    const url = `${this.baseUrl}/${name}/${password}/${role}`;
    return this.http.get<string>(url);
  }
}
